import React from "react";
// import logo from './logo.svg';
import "./App.css";
import { Weather } from "./Components/Weather";
import Time from "./Components/Time";
import Name from "./Components/Name";

//bg
let morningImage = "./assets/img/morning";

function App() {
  let timezone = new Date().toLocaleTimeString();
  let pagi = "AM";
  let malam = "PM";
  console.log(timezone.includes(pagi));

  if (timezone.includes(pagi) === false) {
    return (
      <div className="body" style={{ backgroundImage: { morningImage } }}>
        <div className="App">
          <Name />
          <Time />
          <Weather />
        </div>
      </div>
    );
  } else if (timezone.includes(malam) === true) {
    return (
      <div className="body">
        <div className="App">
          <Name />
          <Time />
          <Weather />
        </div>
      </div>
    );
  } else {
    return null;
  }
}

export default App;
